import React, { useState } from 'react';
import { Nav, NavItem, Dropdown,Row , Col, DropdownItem, DropdownToggle, DropdownMenu, NavLink } from 'reactstrap';

const Signup = (props) => {
  const [dropdownOpen, setDropdownOpen] = useState(false);

  const toggle = () => setDropdownOpen(!dropdownOpen);

  return (
    <div className="signup">
         
      <Row>
          <Col sm={12} md={4} >
          </Col>
          </Row>              
      <Nav tabs>
        <NavItem>
          <NavLink href="#" >Link</NavLink>
        </NavItem>
        
        <NavItem>
          <NavLink href="#" active>Link</NavLink>
        </NavItem>
      
        <NavItem>
          <NavLink  href="/signin">Link</NavLink>
        </NavItem>
      </Nav>
    </div>
  );
}

export default Signup;
